import React, { useState } from "react"

const movesArr = []

function MoveHistory({currMove=undefined})
{
    const[moves,setMoves] = useState(movesArr)

    if(currMove !== undefined)
    {
        setMoves((moves)=>{return [...moves,currMove]})
    }


    return <ol>
        {moves.length !==0 && moves.map((data)=>(
             <li>{data}</li>
        ))}
    </ol>
}

export default MoveHistory
